import logo from './logo.svg';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { Box, Stack, Tab, Tabs, Typography } from '@mui/material';
import CssBaseline from '@mui/material/CssBaseline';
import './App.css';


function App() {
    const theme = createTheme({
        palette: {
            primary: {
              main:  '#da8129',
              dark: '#ffffff',
              light: '#ffffff',
              contrastText: 'rgba(0,0,0,0.87)',
            },
            secondary: {
              main: '#da8129',
            },
            background: {
              paper: '#ffffff',
              default: '#fff6ec',
            },
        },
        components: {
            MuiTab: {
                styleOverrides: {
                    root: {
                        color: '#da8129', // Customize text color
                        textTransform: 'lowercase',
                        fontFamily: [
                            '-apple-system',
                            'BlinkMacSystemFont',
                            '"Segoe UI"',
                            'Roboto',
                            '"Helvetica Neue"',
                            'Arial',
                            'sans-serif',
                            '"Apple Color Emoji"',
                            '"Segoe UI Emoji"',
                            '"Segoe UI Symbol"',
                        ].join(','),
                        '&.Mui-selected': {
                            color: '#da8129', // Customize selected tab text color
                        },
                    },
                },
            },
        }
    })
    return (
        <ThemeProvider theme={theme}>
            <CssBaseline />
            <Stack direction="row">
                <Box
                    sx={{
                        container: 'flex',
                        alignItems: 'right',
                        justifyContent: 'right'
                    }}
                >
                    <Tabs
                        value={0}
                    >
                        <Tab  label="About Me"/>
                        <Tab  label="projects"/>
                        <Tab  label="resume"/>
                        <Tab  label="contact me"/>
                    </Tabs>
                </Box>
             </Stack>
        </ThemeProvider>
  );
}

export default App;
